import '../index.css' 
import React from 'react'
import { NavLink } from "react-router-dom";

function NavBar () {
   return ( <nav className='navbar'>
        <ul className='navbarList'>
            <NavLink to="/home" className="n.active">Home</NavLink>
            <li>About</li>
            <li>Projects</li>
            <li>Resume</li>


        </ul>



    </nav>
    )
}

export default NavBar;
